import { Component, Inject } from '@angular/core';
import { UserService } from 'src/app/Services/User.service';

@Component({
  selector: 'app-user-list',
  templateUrl: './user-list.component.html',
})
export class UserListComponent {
/**
 *
 */
constructor(private userService:UserService) {
}

ListUser=this.userService.GetAllUsers()

}
<div class="admin-user-list">
    <div class="admin-user-detail" *ngFor="let item of ListUser">
        <div class="admin-user-name">{{item.name}}</div>
        <div class="admin-user-gender">{{item.gender}}</div>
        <div class="admin-user-subtype">{{item.subType}}</div>
        <div class="admin-user-active">{{item.status}}</div>
        <button class="admin-user-show-detail-button" (click)="ShowUserDetails(item)">+</button>
    </div>   
</div>
